import * as React from "react";
import Grid from "@mui/material/Grid";
import { Container } from "@mui/system";
import HeaderScreen from "./HeaderScreen";
import TextField from "@mui/material/TextField";

function Register2() {
  return (
    <>
      <Grid>
        <HeaderScreen />
      </Grid>
      <br />
      <br />
      <br />
      <br />


<Container maxWidth="xl"  border={3}>

<Grid container border={3}>



          <Grid item lg={12} sm={6} xs={12} style={{ backgroundColor: "grey" }}>
            <h3>
              Filled Out The Billing Details to Get Paid For Your FIRST Order{" "}
            </h3>
          </Grid>

          <br />



          <Grid
            item
            lg={12}
            sm={6}
            xs={12}
            style={{ backgroundColor: "lightblue" }}
          >
            <h4>Step 2/3 </h4>
          </Grid>
          <br />

          <Grid container style={{ backgroundColor: "pink" }}>

            <Grid item lg={4} sm={6} xs={12} style={{ padding: "30px" }}>
              <TextField color="secondary" style={{width:"370px"}} />
            </Grid>

            <Grid item lg={4} sm={6} xs={12} style={{ padding: "30px" }}>
              <TextField color="secondary" style={{width:"370px"}}  />
            </Grid>

            <Grid item lg={4} sm={6} xs={12} style={{ padding: "30px" }}>
              <TextField color="secondary" style={{width:"370px"}}  />
            </Grid>

          </Grid>
        </Grid>




</Container>
    </>
  );
}

export default Register2;
